import styled from 'styled-components'


const Container = styled.div`
  padding: 20px 20px 0px;
  display: flex;
  flex-direction: column;
  flex: 1 1 0%;
  -webkit-box-pack: end;
  justify-content: flex-end

`

export default class App extends React.Component {
  render(){
  return (
    <Container>
      <h2>astromatch</h2>
    </Container>
)
}
}
